import {observable, action, runInaction, computed} from "mobx";


export default class HomeStore {
    @observable name = '张三';
    @observable age = 100;
    @observable price = 200;

    @computed get aaa(){
        return this.age * this.price
    }

    @action click = ()=> {
        this.name ='test';
        this.age = 500;
    }
    @action handleSearchIn(value){
        setTimeout(()=> {this.props.handleSearch(value);},1500)
      }

    @actiom handleChange(e){
        this.setState({
          value:e.target.value
        })
      }
    @action handleResetson(){
        this.props.handleReset()
        this.setState({
          value:""
        })
      }
}
